import logo from './imgs_svgs/logo.svg';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import Button from './components/button';
import Dot from './components/dot';

import SignIn from './pages/SignIn';
import Register from './pages/Register';




function App() {


let picture = <img class = "parent" id = "rest" alt="stack overflow" src="https://media.cntraveler.com/photos/5b22bfdff04a775484b99dfc/master/pass/Alo-Restaurant__2018_Raffi-Photo-2.jpg"></img>


  return (
    <div class="grid-container">

      <section class="logo">
        <img src={logo} className="App-logo" alt="logo" />
      </section>

      <section class="button">
      <Router>
			<Switch>
				<Route path="/SignIn">
					<SignIn />
           <Button text= "Sign In"/>
				</Route>
				<Route path="/Register">
					<Register />
				</Route>
			</Switch>
		  </Router>
        <Button text= "Sign Up"/>
        <Button text = "Register"/>
      </section>

      <section class="image">
       {picture}
        <div  class = "child" id = "grey"></div>
      </section>

      <section class="mainn">
              <h1 class="maintxt">
                  Forget about deciding where to eat, let us handle it.
              </h1>
      </section>

      <section class="bowl">
          <Dot />
          <span class="dot"></span>
      </section>

    </div>
  );
}

export default App;

